perspectives.style:
@controls {
  bottom {
    filter {
      target: element;
      by: "element type";
      as: buttons;
      multiple: true;
      default: show-all;
    }
  }
}

@settings {
  template: stakeholder;
  connection-curvature: 0.23;
  font-color: #97d7cd;
  connection-size: 1;
  quality: best;
  theme: light;
  layout-preset: hairball;
  layout: force;
}

/* Micro-Context */
element["element type"="Micro-Context"] {
  color: #b9e5a0;
  shape: circle;
  scale: scale("", 0.5, 4);
}

/* People */
element["element type"="Person"] {
  color: #fdc16f;
  shape: pill;
  size: 5;
}

/* Organisation */
element["element type"="Institution"] {
  size: 5;
  color: #f67c49;
  shape: pill;
}

element["element type"="Modes of Engagement"] {
  color: #bce2ee;
  shape: diamond;
  size: 9;
}

@settings {
  template: custom;
}

/* Micro-Context */
element["element type"="Micro-Context"] {
  color: #b9e5a0;
  shape: triangle;
  size: 11;
}

/* People */
element["element type"="Person"] {
  color: #fdc16f;
  shape: pill;
}

/* Organisation */
element["element type"="Institution"] {
  size: 5;
  color: #f67c49;
  shape: pill;
}

element["element type"="Modes of Engagement"] {
  color: #bce2ee;
  shape: diamond;
  size: 9;
}

@controls {
  bottom {
    filter {
      target: element;
      by: "living lab cluster";
      as: buttons;
      multiple: true;
      default: show-all;
    }
  }
}

@settings {
  template: systems;
  element-size: 66;
  connection-size: 18;
  layout-gravity: 0.0015;
  layout-particle-charge: 1300;
  connection-length: 700;
  connection-strength: 0.1;
  font-size: 29;
  cluster: ["element type"="Configuration"] by "Living Lab Cluster", ["element type"="person"], ["element type"="configuration"] by "Micro-Context";
  layout: force;
  theme: light;
  quality: good;
}

element["element type"="Configuration"] {
  size: 41;
  shape: pill;
  color: #fff0a5;
}

element["element type"="Micro-Context"] {
  color: #b9e5a0;
  shape: triangle;
  size: 85;
}

element["element type"="Living Lab Clusters"] {
  color: #e8cf93;
  shape: diamond;
  scale: scale("degree", 0.5, 4);
}

element["element type"="Person"] {
  color: scale("closeness", #fcfbfd, #487bba);
  scale: scale("degree", 0.9, 2.6);
}

element["element type"="Micro-Context"] {
  color: scale("degree", #f7fcf5, #3eaba0);
}
